const Text = ({ type, children }) => {
    switch (type) {
        case "heading":
            return <h1>{children}</h1>;
        case "paragraph":
            return <p>{children}</p>;
        default:
            return <React.Fragment></React.Fragment>;
    }
};

export default Text;
